import 'bootstrap/dist/css/bootstrap.min.css'
import { BrowserRouter } from "react-router-dom";
import {Navbar} from './component/navbar'
import {useRoutes} from "./routes"



function App() {
  const routes = useRoutes(false)
  return (
    <BrowserRouter>
        <Navbar />
        <div className="container">
          {routes}
        </div>
    </BrowserRouter> 
  );
}

export default App;
